import React, {Component} from 'react'
import PropTypes from 'prop-types'

class TapasList extends Component {

  static propTypes = {
    tapas: PropTypes.array.isRequired
  };

  constructor(props){
    super(props)
  }

  render() {

    const {tapas} = this.props;

    let test1 = tapas[0];

    if (test1) {
      console.log("On list: ", test1 );
    }



    return (
      <div className="">
        <div className="list-container">
        <ul className="list-group">
          { // Builing a list
            (tapas && tapas.length > 0 && (tapas.map( tapa => (
              <li key={tapa.referralId} className='card'>
                <div className='card-body'>
                  <img className="photo rounded float-left img-fluid" src={`https://via.placeholder.com/300`} alt="Card image cap" width="300" height="300"/>
                  <div className="card-body">
                    <h5 className="card-title">{tapa.venue.name}</h5>
                    <p className="card-text">Address: {tapa.venue.location.address}</p>
                  </div>
                </div>
              </li>
            ))))
        }
        </ul>
        </div>
      </div>
    )
  }
}

export default TapasList;
